#include <stdio.h>
#include <stdlib.h>
#include <string.h>

#define MAXN 100005
#define MAXC 20

typedef struct {
    char color[MAXC];
    int density;
    int index;
} Color;

int compare(const void *a, const void *b) {
    Color *x = (Color *)a;
    Color *y = (Color *)b;
    return x->density - y->density;
}

int main() {
    int N, M;
    scanf("%d", &N);
    Color colors[N];
    for (int i = 0; i < N; i++) {
        scanf("%s %d", colors[i].color, &colors[i].density);
        colors[i].index = i;
    }
    qsort(colors, N, sizeof(Color), compare);
    scanf("%d", &M);
    int last_index = N;
    for (int i = 0; i < M; i++) {
        char color[MAXC];
        scanf("%s", color);
        int found = 0;
        for (int j = last_index - 1; j >= 0; j--) {
            if (strcmp(colors[j].color, color) == 0) {
                found = 1;
                last_index = j;
                break;
            }
        }
        if (!found) {
            printf("No\n");
            return 0;
        }
    }
    printf("Yes\n");
    return 0;
}
